import React from "react";
export default function Button({closeModle},...prop){
    return (
        <div className="div-right" style={{gridColumn:prop.column,gridRow:prop.rows}}>
            <div className="cart">
                {/* <h1>{data}</h1> */}
                <div className="mnue"></div>

                <button type="button" className="confirm" onClick={()=>closeModle()}>Confirm Order</button>
            </div>
        </div>
        
    )
}
